import unittest
import image_helper

class ImageHelperTest(unittest.TestCase):
    def test_save_base64_encoded_image_to_tmp(self):
        base64_image = 'data:image/jpeg;base64,'
        res = image_helper.save_base64_image_to_tmp(base64_image)
        self.assertTrue(res.startswith('/tmp/'))

if __name__ == '__main__':
    unittest.main(warnings='ignore')
